import React, {useEffect, useState} from "react"

export default function () {
    const [grid, setGrid] = useState([]);

    useEffect(() => {
        initGrid(10, 10);
    }, [])

    const initGrid = (row, col) => {
        const tempGrid = []

        for(var i = 0; i < row; i ++) {
            const currRow = [];
            for(var j = 0; j < col; j++) {
                currRow.push(j);
            }

            tempGrid.push(currRow);
        }

        console.log(tempGrid);
        setGrid(tempGrid);
    }


    return (
        <div className="grid">

        </div>
    )
}
